def calculate_wood_volume(forest, queries):
    n = len(forest)
    m = len(forest[0])
    prefix_sum = [[0] * m for _ in range(n)]
    prefix_sum[0][0] = forest[0][0]
    for j in range(1, m):
        prefix_sum[0][j] = prefix_sum[0][j - 1] + forest[0][j]
    for i in range(1, n):
        prefix_sum[i][0] = prefix_sum[i - 1][0] + forest[i][0]
    for i in range(1, n):
        for j in range(1, m):
            prefix_sum[i][j] = prefix_sum[i - 1][j] + prefix_sum[i][j - 1] - prefix_sum[i - 1][j - 1] + forest[i][j]
    results = []
    for (x1, y1, x2, y2) in queries:
        x1 += 1
        y1 -= 1
        x2 -= 1
        y2 -= 1
        total_volume = prefix_sum[x2][y2]
        if x1 > 0:
            total_volume -= prefix_sum[x1 - 1][y2]
        if y1 > 0:
            total_volume -= prefix_sum[x2][y1 - 1]
        if x1 > 0 and y1 > 0:
            total_volume += prefix_sum[x1 - 1][y1 - 1]
        results.append(total_volume)
    return results

